-- automatically taken for h2 configs
CREATE SEQUENCE student_sequence
  START WITH 269
  INCREMENT BY 50;

CREATE SEQUENCE course_sequence
  START WITH 10
  INCREMENT BY 50;

CREATE SEQUENCE mark_sequence
    START WITH 21627
    INCREMENT BY 50;

create table STUDENT
(
   ID NUMBER(19),
   FULL_NAME VARCHAR2(255 char) not null,
   CONSTRAINT PK_STUDENT PRIMARY KEY(ID)
);

create table COURSE
(
   ID NUMBER(19),
   NAME VARCHAR2(255 char) not null,
   CONSTRAINT PK_COURSE PRIMARY KEY(ID)
);

create table MARK
(
   ID NUMBER(19),
   MARK NUMBER(19, 2) not null,
   STUDENT_ID NUMBER(19) not null,
   COURSE_ID NUMBER(19) not null,
   MARK_DATE TIMESTAMP(6) not null,
   CONSTRAINT PK_MARK PRIMARY KEY(ID),
   CONSTRAINT FK_COURSE_ID FOREIGN KEY (COURSE_ID) REFERENCES COURSE(ID),
   CONSTRAINT FK_STUDENT_ID FOREIGN KEY (STUDENT_ID) REFERENCES STUDENT(ID)
);




